sys_variable_value.value:
(function execute(inputs, outputs) {

    var parsedJson = inputs.json_string;
    var delimiter_value = inputs.delimiter.toString().trim();
    var costCenterArray = new sn_sap_data_int.IntegrationsUtils().parseExecuteRFC(parsedJson, delimiter_value);
    outputs.cost_center = costCenterArray.JSONOBJECT;
    outputs.total_rows = costCenterArray.ROWCOUNT;

    for(var i=0; i < outputs.cost_center.length;i++){
    var toDate = JSON.stringify(outputs.cost_center[i].DATBI);
    var fromDate = JSON.stringify(outputs.cost_center[i].DATAB);
    var createdOn = JSON.stringify(outputs.cost_center[i].ERSDA);
    outputs.cost_center[i].DATBI = toDate.substring(1,5)+"-"+toDate.substring(5,7)+"-"+toDate.substring(7,9);
    outputs.cost_center[i].DATAB = fromDate.substring(1,5)+"-"+fromDate.substring(5,7)+"-"+fromDate.substring(7,9);
    outputs.cost_center[i].ERSDA = createdOn.substring(1,5)+"-"+createdOn.substring(5,7)+"-"+createdOn.substring(7,9);
    }

})(inputs, outputs);

